window.bookSummaryJSON = "<p>Every generation in the secluded Kingdom of Yanasu, a child is born with the power to heal the very life force coursing through the veins of all living beings.</p> <p>Now Kaine, an outsider from a distant continent, finds himself at the doorsteps of Yanasu, seeking help and guidance for his newly revealed healing powers. He never expected to become the ward of the ailing High Priest, or to grow close to Na’Serra, a princess coming into her own fantastic abilities.</p> <p>When a deadly anti-magic cult targets Na’Serra for her developing powers, she and Kaine must quickly work to unlock their own potential and save not only their loved ones, but all the free people of the world.</p> <p>All the while, a troubling question lingers for Kaine: Was he gifted his powers by the dark otherworldly force that’s been whispering in his ear, or was he born to be a Light Giver?</p>"; 
